import logo from "./images/netflix-Logo.svg";
import magnifying_glass from "./images/magnifying_glass.svg";
import notification_bell from "./images/notification_bell.png";
import avatar from "./images/avatar.png";
import arrow from "./images/triangle_arrow.png";
import React from "react";
import HeaderCss from "./header.module.css";

function Header() {
  return (
    <>
      <div>
        <nav>
          <img className={HeaderCss.nav_logo} src={logo} alt="Netflix Logo" />
                 
        </nav>
      </div>
    </>
  );
}

export default Header;
